                <div class="row">

                    <div class="col-lg-5 d-flex align-items-stretch">
                        @if(count($contact)>0)
                            <div class="info">
                            @foreach($contact as $item)
                                @if($item->address)
                            <div class="address">
                                <i class="icofont-google-map"></i>
                                <h4>Адрес:</h4>
                                <p>{{$item->address}}</p>
                            </div>
                                    @endif
                            @if($item->phone)
                            <div class="phone">
                                <i class="icofont-phone"></i>
                                <h4>Номер:</h4>
                                <p>{{$item->phone}}</p>
                            </div>
